import React from "react";

const penguim = () => (
    <div className="info">
        <h1>Penguim</h1>
        <p>O pinguim é uma ave que vive principalmente nas regiões polares do planeta. Com sua plumagem preta e branca e seu jeito desengonçado de andar, é um animal adorado por muitas pessoas.
            Existem diversas espécies de pinguins, sendo que a maioria vive no Hemisfério Sul, em locais como a Antártida, Ilhas Malvinas, Ilhas Galápagos e Nova Zelândia. Eles se alimentam de peixes, crustáceos e krill, e são excelentes nadadores, podendo chegar a velocidades de até 40km/h na água.</p>
    </div>
);

export default penguim;
